import wineParty from '../../assets/wine_party.png';
import dollar from '../../assets/dollar.png';
import meal from '../../assets/diet.png';
import calendar from '../../assets/calendar.png';
import pricing from '../../assets/pricing.png';
import questions from '../../assets/questions.png'
import Logo from '../Logo';
import { Link } from 'react-router-dom';
import '../../styles/LandingPage.css';

import LoginForm from './LoginForm';

import Features from "./Features";

function LandingPage() {

  return (
    <div className="main">
          <ul className="homeNavbarMenu">
            <Link to="#features">
              <li>
                  Features
              </li>
            </Link>
            <Link to="#pricing">
              <li>
                  Pricing
              </li>
            </Link>
            <Link to="#faq">
              <li>
                  FAQ
              </li>
            </Link>
          </ul>
      <div className="row1">
        <div className="container">
              <Logo />
              <p id="slogan">The best wine experience wherever you are.</p>
              <LoginForm />
              {/* <ImageList list={list} /> */}
            </div>
              <img id="wineParty" src={wineParty}/>
        </div>

        <Features />

        <div id="pricing">
          <p className="sectionHeader" class='pricing'>Pricing</p>
          <p className='pricingSlogan'>An investment in a better wine experience. </p>
          {/* Improve your wine experience for just 33 cents a day. */}
          <p id="pricingCost">$9.<sup>99</sup></p>


          <img id="pricingImage" src={pricing}/>
          {/* Illustration by <a href="https://icons8.com/illustrations/author/602b6fa7123f993a3afdba7b">  Victoria Chepkasova</a> from <a href="https://icons8.com/illustrations">Ouch!</a> */}
        </div>

        <div id="faq">
          <p className="sectionHeader" class='faq'>Questions</p>
          <img id="questionImage" src={questions}/>
          How does it work?
        </div>

    </div>
  );
}

export default LandingPage;
